import React from "react";
import { Link } from "react-router-dom";
import "./Home.module.css"; // Agar aap CSS module use kar rahe hain

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="title">Welcome to the Attendance System</h1>
      <p>Please log in to start tracking your attendance.</p>


      <div className="button-container">
        <Link to="/login">
          <button className="login-btn">Login</button>
        </Link>
        <Link to="/dashboard">
          <button className="dashboard-btn">Go to Dashboard</button>
        </Link>
      </div>
    </div>
  );
};

export default Home;
